import React, { Component } from "react";
import Slider from "react-slick/lib/slider";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import newclasses from "./questionsCarousel.module.css";

import Button from "./UI/Button";

function QuestionsCarousel() {
  let settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: false,
  };
  return (
    <div>
      <h2> Single Item</h2>

      <Slider {...settings}>
        <div>
          <h3 className={newclasses.btn}>Pregunta</h3>
          <p>texto</p>
          <Button>Presione aqui para la respuesta</Button>
        </div>
        <div>
          <h3>2</h3>
        </div>
        <div>
          <h3>3</h3>
        </div>
        <div>
          <h3>4</h3>
        </div>
        <div>
          <h3>5</h3>
        </div>
        <div>
          <h3>6</h3>
        </div>
      </Slider>
    </div>
  );
}

export default QuestionsCarousel;
